    data: |
      SELECT - ( - COUNT ( * ) ) * ( - SUM ( + col2 ) ) FROM tab0 (FORMAT parquet) AS cor0 WHERE col2 NOT BETWEEN col0 AND col2 / - + col2 - + col0 * - 51 + - col1;
  - name: tab0

outputs:
  - name: q13392.out
    data: |
      -10
